INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (123,'en','Miura','<p>The Lamborghini Miura is a sports car produced by Italian automaker Lamborghini between 1966 and 1973. The car was the first supercar with a rear mid-engined two-seat layout, although the concept was first pioneered by Ren√© Bonnet with the Matra Djet in 1964. This layout has since become the standard for high-performance sports and supercars. When released, it was the fastest production road car.</p>\n');
