INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (136,'en','190 SL','<p>The Mercedes-Benz 190 SL (W121) is a two-door luxury roadster produced by Mercedes-Benz between May 1955 and February 1963. Internally referred to as W121 (BII or B2), it was first shown in prototype at the 1954 New York Auto Show, and was available with an optional removable hardtop.</p>\n');
