INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (140,'en','300 SL','<p>The Mercedes-Benz 300 SL (chassis code W 198) was produced from 1954 to 1963. It was first produced as a coupe from 1954 to 1957 with gullwing doors and then from 1957 to 1963 as a roadster. The direct fuel injected production version was based on the company\'s less powerful carburettor-powered overhead camshaft straight-6 engine 1952 racer, the W194.</p>\n');
