INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (147,'en','Comet','<p>The Mercury Comet is an automobile that was produced by Mercury from 1962‚Äì1969 and 1971‚Äì1977 ‚Äî variously as either a compact or an intermediate car.</p>\n\n<p>The Comet was initially based on the compact Ford Falcon, then on the intermediate Ford Fairlane and finally on the compact Ford Maverick. As a Mercury, early Comets received better grade interior trim than concurrent Falcons, and a slightly longer wheelbase.</p>\n');
