INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (178,'en','R4','<p>The&nbsp;<strong>Renault 4</strong>, also known as the&nbsp;<strong>4L</strong>&nbsp;(pronounced \"Quatrelle\"), is a&nbsp;<a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://en.wikipedia.org/wiki/Hatchback\" tabindex=\"-1\" title=\"Hatchback\">hatchback</a>&nbsp;<a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://en.wikipedia.org/wiki/Economy_car\" tabindex=\"-1\" title=\"Economy car\">economy car</a>&nbsp;produced by the French automaker&nbsp;<a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://en.wikipedia.org/wiki/Renault\" tabindex=\"-1\" title=\"Renault\">Renault</a>&nbsp;between 1961 and 1994. It was the first&nbsp;<a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://en.wikipedia.org/wiki/Front-wheel_drive\" tabindex=\"-1\" title=\"Front-wheel drive\">front-wheel drive</a>&nbsp;family car produced by Renault.</p>\n');
