INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (189,'en',NULL,'<p>The&nbsp;<strong>Triumph TR6</strong>&nbsp;(1968‚Äì76) is a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sports_car\" title=\"Sports car\">sports car</a>&nbsp;built by British&nbsp;<a href=\"https://en.wikipedia.org/wiki/Triumph_Motor_Company\" title=\"Triumph Motor Company\">Triumph Motor Company</a>&nbsp;between 1968 and 1976. It was the best-seller of the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Triumph_TR\" title=\"Triumph TR\">TR range</a>&nbsp;when production ended, a record subsequently surpassed by the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Triumph_TR7\" title=\"Triumph TR7\">TR7</a>. Of the 91,850 TR6s produced, 83,480 were exported; only 8,370 were sold in the UK.</p>\n');
