INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (190,'en','TR 4','<p>The&nbsp;<strong>Triumph TR4</strong>&nbsp;is a sports car produced by the&nbsp;<a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://en.wikipedia.org/wiki/Triumph_Motor_Company\" tabindex=\"-1\" title=\"Triumph Motor Company\">Triumph Motor Company</a>&nbsp;from 1961 to 1965. Code named \"Zest\" during development, it was the successor to the&nbsp;<a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://en.wikipedia.org/wiki/Triumph_TR3#TR3A\" tabindex=\"-1\" title=\"Triumph TR3\">TR3A</a>. The car was based on the chassis and drivetrain of the previous TR sports cars, but with a modern body designed by&nbsp;<a data-tabindex-counter=\"1\" data-tabindex-value=\"none\" href=\"https://en.wikipedia.org/wiki/Giovanni_Michelotti\" tabindex=\"-1\" title=\"Giovanni Michelotti\">Michelotti</a>. As 40,253 cars were built during its production years it proved to be very successful.</p>\n');
