INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (225,'en','Karmann','<p>The Volkswagen Karmann Ghia is a sports car marketed in 2+2 coupe (1955‚Äì1974) and 2+2 convertible (1957‚Äì1974) body styles by Volkswagen. Internally designated the Typ 14, the Karmann Ghia combined the chassis and mechanicals of the Type 1 (Beetle) with styling by Italy\'s Carrozzeria Ghia and hand-built bodywork by German coachbuilding house, Karmann.</p>\n');
