INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (233,'en','Type 2','<p>The Volkswagen Type 2, known officially (depending on body type) as the Transporter, Kombi or Microbus, or, informally, as the Bus (US) or Camper (UK), is a forward control panel van introduced in 1950 by the German automaker Volkswagen as its second car model. Following ‚Äì and initially deriving from Volkswagen\'s first model, the Type 1 (Beetle) ‚Äì it was given the factory designation Type 2.</p>\n');
