INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (242,'en','DB5','<p>The Aston Martin DB5 is a British luxury grand tourer (GT) that was made by Aston Martin and designed by the Italian coachbuilder Carrozzeria Touring Superleggera. Released in 1963, it was an evolution of the final series of DB4. The DB series was named honouring Sir David Brown (the owner of Aston Martin from 1947 to 1972).</p>\n\n<p>Although not the first in the DB series, the DB5 is the best-known cinematic James Bond car, first appearing in the James Bond film Goldfinger (1964).</p>\n');
