INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (248,'en','DB6','<p>The Aston Martin DB6 is a grand tourer made by British car manufacturer Aston Martin. Produced from September 1965 to January 1971, the DB6 had the longest production run up to that date of any Aston Martin model. The DB6 succeeded the Aston Martin DB5 and featured improved aerodynamics and specification over its predecessor.</p>\n');
