INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (254,'en','Impala','<p>The Impala was introduced for the 1958 model year as top of the line Bel Air hardtops and convertibles. From the windshield pillar rearward, the 1958 Bel Air Impala differed structurally from the lower-priced Chevrolet models. Hardtops had a slightly shorter greenhouse and longer rear deck. The wheelbase of the Impala was longer than the lower priced models, although the overall length was identical. Interiors held a two-spoke steering wheel and color-keyed door panels with brushed aluminum trim. No other series included a convertible.</p>\n');
