INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (260,'en','1900','<p>The Alfa Romeo 1900 is an automobile produced by Italian car manufacturer Alfa Romeo from 1950 to 1959. Designed by Orazio Satta, it was an important development for Alfa Romeo as the marque\'s first car built entirely on a production line and first production car without a separate chassis. It was also the first Alfa Romeo offered with left-hand drive. The car was introduced at the 1950 Paris Motor Show.</p>\n');
