INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (289,'en','XK150','<p>The Jaguar XK150 is a sports car produced by Jaguar between 1957 and 1961 as the successor to the XK140.</p>\n\n<p>Initially it was only available in fixed head coup√© (FHC) and drophead coup√© (DHC) versions. The roadster without full weather equipment which had begun the XK line was launched as the XK150 OTS (open two-seater) in 1958. Minimal rear seats were fitted in the coup√©s. The open two-seater was fitted for the first time with wind-up windows in taller high-silled doors, but retained the very simple folding roof of its predecessors.</p>\n');
