INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (302,'en','Isetta','<p>The Isetta is an Italian-designed microcar built under license in a number of different countries, including Argentina, Spain, Belgium, France, Brazil, Germany, and the United Kingdom. Because of its egg shape and bubble-like windows, it became known as a bubble car, a name also given to other similar vehicles.</p>\n\n<p>In 1955, the BMW Isetta became the world\'s first mass-production car to achieve a fuel consumption of 3 L/100 km (94 mpg/imp; 78 mpg/US). It was the top-selling single-cylinder car in the world, with 161,728 units sold.</p>\n\n<p>Initially manufactured by the Italian firm Iso SpA, the name Isetta is the Italian diminutive form of Iso, meaning \"little Iso\".</p>\n');
