INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (307,'en','600','<p>The BMW 600 is a four-seater microcar produced by the German automaker BMW from mid-1957 until November 1959. Partially based on the BMW Isetta two-seater, it was BMW\'s first postwar four-seater economy car. It was not a sales success, but it began the design process for its more successful successor, the BMW 700.</p>\n');
