INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (319,'en','220','<p>The Mercedes-Benz W187 is a full-size luxury car produced by Mercedes-Benz from 1951 to 1955. Introduced at the Frankfurt Motor Show in April 1951, the W187 was powered by a single overhead camshaft inline six-cylinder M180 engine and available as a saloon, coup√©, and cabriolet, all designated with the 220 model name.</p>\n');
