INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (327,'en','W128','<p>The Mercedes-Benz W128 is a 6-cylinder luxury car produced by Mercedes-Benz from 1958 to 1960. It was available in sedan, coup√©, or cabriolet body styles. Marketed as the Mercedes-Benz 220SE, it was the last of the \"Ponton\" series which had design roots and styling cues beginning in 1953 with the Mercedes-Benz 180 sedan (W120 chassis).</p>\n');
