INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (335,'en','W111','<p>The Mercedes-Benz W111 was a chassis code given to a range of Mercedes-Benz vehicles produced between 1959 and 1971, including four-door sedans (1959-1968) and two-door coup√©s and cabriolets (1961 to 1971).</p>\n\n<p>Introduced as inline 6-cylinder cars with 2.2-litre engines, the W111 spawned two lines of variants: entry-level vehicles sharing its chassis and bodies but with four-cylinder engines were designated the W110. A luxury version built on the W111 chassis with its body and the fuel-injected 3-litre M186 six-cylinder engine was designated the W112.</p>\n');
