INSERT INTO object_localized_data_CAR (`ooo_id`,`language`,`name`,`description`) VALUES (349,'en','W113','<p>The Mercedes-Benz W 113 is a two-seat roadster/coup√©, introduced at the 1963 Geneva Motor Show, and produced from 1963 through 1971. It replaced both the 300 SL (W 198) and the 190 SL (W 121 BII). Of the 48,912 W 113 SLs produced, 19,440 were sold in the US.</p>\n');
